    playbackData.comments = {"4b6dff7b-f258-4626-99b1-c1bc0dcfe96e":[{"id":"85368484-6b10-4e0f-8555-0dea10863bfb","displayCommentEventId":"4b6dff7b-f258-4626-99b1-c1bc0dcfe96e","displayCommentEventSequenceNumber":0,"developerGroupId":"0d1b7b7f-ba86-40dc-9ee3-67ca5d5ec064","timestamp":1726799994571,"commentText":"A short playback covering the <span style=\"font-family: Courier;\">mutate()</span> function.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"ecfefd1b-e4b7-4895-9d6a-866288efec6d":[{"id":"e18b6168-1657-4daf-8c09-eb520d2bda63","displayCommentEventId":"ecfefd1b-e4b7-4895-9d6a-866288efec6d","displayCommentEventSequenceNumber":91,"developerGroupId":"21504f2e-7a5b-49a7-853a-eb68be17b8e7","timestamp":1726801736856,"commentText":"To begin, our motivating question will be to compute the average number of flights per day in a given month.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/mutate.r","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"0a5663e6-53ac-489b-9ede-dec9fc61754d":[{"id":"3fee6078-10a8-4ee0-bbed-01f54aa4ff22","displayCommentEventId":"0a5663e6-53ac-489b-9ede-dec9fc61754d","displayCommentEventSequenceNumber":245,"developerGroupId":"21504f2e-7a5b-49a7-853a-eb68be17b8e7","timestamp":1726802407786,"commentText":"This code is review from the last playback.&nbsp; We can count the <span style=\"font-weight: bold;\">n</span>umber of rows in each group with <span style=\"font-family: Courier;\">n()</span>.&nbsp; We use the <span style=\"font-family: Courier;\">summarize()</span> function when we wish to apply a specific function to the groups created with <span style=\"font-family: Courier;\">group_by()</span>.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/mutate.r","viewableBlogText":"","commentTags":["question"],"questionCommentData":{"allAnswers":["total","n","summarize"],"correctAnswer":"total","question":"The output of this pipeline will be a data frame with columns for the month and the number of objects in each group.&nbsp; What is the column with the number of objects in each group called?","explanation":"The word on the left had side of the = sign is the name we want to create for the new column."}},{"id":"557d1944-58b9-48c8-9ed8-95bacee4ed47","displayCommentEventId":"0a5663e6-53ac-489b-9ede-dec9fc61754d","displayCommentEventSequenceNumber":245,"developerGroupId":"21504f2e-7a5b-49a7-853a-eb68be17b8e7","timestamp":1726802557015,"commentText":"This code shows us only the months and the total number of flights each month.&nbsp; Perhaps unsurprisingly, February has the fewest flights.<div><br></div><div>But February only had 28 days in which to have flights!&nbsp; Maybe a different month with more days actually served fewer flights per day on average.&nbsp;</div>","commentTitle":"","position":1,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/mutate.r","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"2aa50947-a32f-4074-9dfc-cf05f2be1ca5":[{"id":"bf2cb991-d3af-4bc1-b956-7b7d4545fe51","displayCommentEventId":"2aa50947-a32f-4074-9dfc-cf05f2be1ca5","displayCommentEventSequenceNumber":320,"developerGroupId":"21504f2e-7a5b-49a7-853a-eb68be17b8e7","timestamp":1726802661274,"commentText":"To find the average number of flights per day in each month, we want to divide the monthly flight total by the number of days in that month.<div><br></div><div>We know the number of days in each month, but can we have the computer determine this value from our data?</div><div><br></div><div>Assuming that there are flights every day of the year, we can, also using techniques we've seen before.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/mutate.r","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"d5b17a4b-235b-4139-8b70-8767f950730e":[{"id":"bac3f412-72d5-4d35-9677-dcdc43b1241c","displayCommentEventId":"d5b17a4b-235b-4139-8b70-8767f950730e","displayCommentEventSequenceNumber":409,"developerGroupId":"21504f2e-7a5b-49a7-853a-eb68be17b8e7","timestamp":1726802853053,"commentText":"<div>If we group our<span style=\"font-family: Courier;\"> flights </span>by month and then select the highest day value occurring in each month, we'll have what we want.</div><div><br></div>Remember there are actually many flights on the last day of each month, and by default, <span style=\"font-family: Courier;\">slice_()</span> functions return all records satisfying the condition.&nbsp; We don't need to see the number 28 roughly 900 times for February, just once will suffice.&nbsp; To do this, we can set the <span style=\"font-family: Courier;\">with_ties</span> argument to <span style=\"font-family: Courier;\">FALSE</span> to tell the <span style=\"font-family: Courier;\">slice_max()</span> function we do NOT want it to keep ties in the data frame.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/mutate.r","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"83d818ef-4983-4c12-9aeb-1a4b8152f778":[{"id":"cd203105-104a-4dd3-ac52-dde53e8d7528","displayCommentEventId":"83d818ef-4983-4c12-9aeb-1a4b8152f778","displayCommentEventSequenceNumber":437,"developerGroupId":"21504f2e-7a5b-49a7-853a-eb68be17b8e7","timestamp":1726840992308,"commentText":"If we select just the <span style=\"font-family: Courier;\">day</span> column, we won't see the values in all other columns that aren't important to us right now.&nbsp; Again, notice that <span style=\"font-family: Courier;\">month</span> is included in the output shown below, because the grouping columns are always shown.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1726840986272-DaysInMonth.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/mutate.r","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"9674d907-e155-4caa-89fa-c27413eaa8f4":[{"id":"457816e8-0f50-4c04-86ff-94a109105f16","displayCommentEventId":"9674d907-e155-4caa-89fa-c27413eaa8f4","displayCommentEventSequenceNumber":486,"developerGroupId":"21504f2e-7a5b-49a7-853a-eb68be17b8e7","timestamp":1726841187172,"commentText":"We have now seen the code to create each of the things we want separately.&nbsp; How can we put them together?&nbsp;&nbsp;<div><br></div><div>There are several ways to do this, but the method I present here will focus on single pipelines.</div><div><br></div><div>And woah!&nbsp; A bear!&nbsp; What's that doing here?</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1726841184681-bear.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/mutate.r","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"99f7aa2f-8e1c-4c8a-83a0-94f41e6bed86":[{"id":"940cce93-fa8f-49f0-84be-0017ba92f727","displayCommentEventId":"99f7aa2f-8e1c-4c8a-83a0-94f41e6bed86","displayCommentEventSequenceNumber":580,"developerGroupId":"21504f2e-7a5b-49a7-853a-eb68be17b8e7","timestamp":1726841480646,"commentText":"Since both individual frames rely on grouping by month, the first line of code <span style=\"font-family: Courier;\">flights |&gt; group_by(month)</span> stays the same.<div><br></div><div>After that, we wish to add a summary statistic, but in fact two summary statistics.&nbsp; We wish to count the <span style=\"font-weight: bold;\">n</span>umber of things in each group (the total number of flights), but we also wish to determine the maximum value in an existing column&nbsp; <span style=\"font-style: italic;\">by group</span>.&nbsp; Our new columns will be titled <span style=\"font-family: Courier;\">total</span> and <span style=\"font-family: Courier;\">n_days</span>.</div><div><br></div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/mutate.r","viewableBlogText":"","commentTags":["question"],"questionCommentData":{"allAnswers":["12 rows, 2 columns","12 rows, 3 columns","336,776 rows, 17 columns","336,776 rows, 19 columns"],"correctAnswer":"12 rows, 3 columns","question":"We plan to pass the output of the summarize() function to our next column.&nbsp; How many rows and columns does this output have?","explanation":"One row for each month and three columns: <span style=\"font-family: Courier;\">month, total,</span> and <span style=\"font-family: Courier;\">n_days</span>."}},{"id":"f8ef013d-ae17-4d47-89f7-91c1828cb45c","displayCommentEventId":"99f7aa2f-8e1c-4c8a-83a0-94f41e6bed86","displayCommentEventSequenceNumber":580,"developerGroupId":"21504f2e-7a5b-49a7-853a-eb68be17b8e7","timestamp":1726841535607,"commentText":"The output of just this much code is shown below.","commentTitle":"","position":1,"selectedCodeBlocks":[],"imageURLs":["media/images/1726841532270-DaysAndFlights.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/mutate.r","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"8e243752-c5e8-48ba-8030-a3035650beff":[{"id":"eab1d134-c6da-4a45-9a05-8e1cacb8e828","displayCommentEventId":"8e243752-c5e8-48ba-8030-a3035650beff","displayCommentEventSequenceNumber":626,"developerGroupId":"21504f2e-7a5b-49a7-853a-eb68be17b8e7","timestamp":1726851360482,"commentText":"The new function for this playback is <span style=\"font-family: Courier;\">mutate()</span>, which allows us to add new columns to data frames by calculations from existing columns.&nbsp;&nbsp;<div><br></div><div>The syntax for<span style=\"font-family: Courier;\"> mutate()</span> is similar to that of <span style=\"font-family: Courier;\">summarize()</span>.&nbsp; First, we provide the name of a new column to add to the data frame, followed by an equal sign.&nbsp; What goes on the right of the equal sign is the value we want assigned to that new column.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/mutate.r","viewableBlogText":"","commentTags":["question"],"questionCommentData":{"allAnswers":["total","n_days","avg_fpd"],"correctAnswer":"avg_fpd","question":"What is the name of the new column being added to the data frame via <span style=\"font-family: Courier;\">mutate()</span>?","explanation":""}},{"id":"85035b1b-fafe-4785-aaf0-7ec9c3b302cf","displayCommentEventId":"8e243752-c5e8-48ba-8030-a3035650beff","displayCommentEventSequenceNumber":626,"developerGroupId":"21504f2e-7a5b-49a7-853a-eb68be17b8e7","timestamp":1726851565584,"commentText":"The output of just these lines of code is shown below.","commentTitle":"","position":1,"selectedCodeBlocks":[],"imageURLs":["media/images/1726851553463-FPD.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/mutate.r","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"a7f649eb-8184-41b5-894d-fe0183c01c22":[{"id":"d2fb2274-87e7-4df3-ad95-5b87916d702e","displayCommentEventId":"a7f649eb-8184-41b5-894d-fe0183c01c22","displayCommentEventSequenceNumber":704,"developerGroupId":"21504f2e-7a5b-49a7-853a-eb68be17b8e7","timestamp":1726851698344,"commentText":"I can't resist asking a second question: namely, what flight do we have on record that is the fastest flight?<div><br></div><div>Also, a turtle!&nbsp; Wow, what's that doing here?</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1726851696441-turtle.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/mutate.r","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"26c3542a-fa7a-494e-810f-dd21074c9f57":[{"id":"bb4a7a1e-f3c1-4e2e-8f55-48046230caba","displayCommentEventId":"26c3542a-fa7a-494e-810f-dd21074c9f57","displayCommentEventSequenceNumber":781,"developerGroupId":"21504f2e-7a5b-49a7-853a-eb68be17b8e7","timestamp":1726851913642,"commentText":"Our current flights data frame has an <span style=\"font-family: Courier;\">air_time</span> column, indicating how much time in minutes the flight spent in the air, and a <span style=\"font-family: Courier;\">distance</span>&nbsp;column with the distance the flight traveled.&nbsp; From this, we should be able to compute speed (distance / time).<div><br></div><div>Since it is more reasonable to talk about the speed of a plane in miles per hour, we add a helper column to the data frame that is the <span style=\"font-family: Courier;\">air_time</span> but thought of in miles per hour.&nbsp; This is the first column we add to the data frame.&nbsp; The second column we add is then the speed in miles per hour.&nbsp;&nbsp;</div><div><br></div><div>The output of this data frame is shown below.&nbsp; Notice that we have added the columns to the data frame (they are listed as columns), but we can't see them because they are at the end of the data frame.&nbsp;&nbsp;</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1726851874125-Mutate1.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/mutate.r","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"bb56d127-ab5f-4941-9839-dcf7624112e5":[{"id":"d00b1d79-accb-4d11-87a8-f306ddad0634","displayCommentEventId":"bb56d127-ab5f-4941-9839-dcf7624112e5","displayCommentEventSequenceNumber":794,"developerGroupId":"21504f2e-7a5b-49a7-853a-eb68be17b8e7","timestamp":1726852050316,"commentText":"By default, <span style=\"font-family: Courier;\">mutate() </span>places newly created columns at the end of the data frame.&nbsp; This is problematic if you have many columns and you want to see the values in the newly created columns.&nbsp; One remedy you can take is to add the columns to a different location in the data frame.<div><br></div><div><span style=\"font-family: Courier;\">.before</span> is an argument to the <span style=\"font-family: Courier;\">mutate()</span> function where you can specify the column <span style=\"font-style: italic;\">number</span>&nbsp;you wish to place the new values before.&nbsp; Using<span style=\"font-family: Courier;\"> .before = 1</span> will place the new columns at the start of the data frame, where we will be able to see them.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1726852044841-Mutate2.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/mutate.r","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"c37bdfcd-7cca-43c1-b94b-63f5516e07c4":[{"id":"3968d882-9346-4383-8c81-3dfbf3266c0c","displayCommentEventId":"c37bdfcd-7cca-43c1-b94b-63f5516e07c4","displayCommentEventSequenceNumber":819,"developerGroupId":"21504f2e-7a5b-49a7-853a-eb68be17b8e7","timestamp":1726852167804,"commentText":"Another option for mutate() is to use<span style=\"font-family: Courier;\"> .keep = \"used\"</span> instead.&nbsp; This will add the columns to the end of the data frame, but will only print the columns used in the computations.&nbsp; Because <span style=\"font-family: Courier;\">air_time</span> and <span style=\"font-family: Courier;\">distance</span> were used to create the new columns, they are printed along with the new columns.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1726852115407-Mutate3.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/mutate.r","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"72e38b0f-2bdf-4386-8e0f-29888b4ec5cb":[{"id":"d2026b12-df20-43f6-8f24-db4d3b200190","displayCommentEventId":"72e38b0f-2bdf-4386-8e0f-29888b4ec5cb","displayCommentEventSequenceNumber":856,"developerGroupId":"21504f2e-7a5b-49a7-853a-eb68be17b8e7","timestamp":1726852347153,"commentText":"To actually answer our question and find the fastest flight, we want to arrange our data frame.&nbsp; Because the <span style=\"font-family: Courier;\">arrange() </span>places things by default numerically from smallest to largest, we also need to call <span style=\"font-family: Courier;\">desc()</span> if we want things in descending order (biggest to smallest).<div><br></div><div>The output of this is shown below.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1726852387948-Mutate4.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/mutate.r","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"314363d0-92ed-4a4c-b096-67cd14aefb37":[{"id":"abed1a37-0c37-4bb2-ba8a-811bc6dfd898","displayCommentEventId":"314363d0-92ed-4a4c-b096-67cd14aefb37","displayCommentEventSequenceNumber":926,"developerGroupId":"21504f2e-7a5b-49a7-853a-eb68be17b8e7","timestamp":1726852374911,"commentText":"The previous code we had showed us the fastest flight (703 miles per hour).&nbsp; Let's find out more about it, maybe like when we experienced this fastest flight, and where it went.&nbsp; In this situation, we want some columns, like our new columns, but also others that weren't involved in the computation.&nbsp;&nbsp;<div><br></div><div>If we wish to do this, it's best to just turn back to <span style=\"font-family: Courier;\">select()</span>, which helps us designate exactly which columns we wish to see.&nbsp; If we do this, there's no need to place the columns in a particular order or only keep some of them, so we remove these optional arguments to <span style=\"font-family: Courier;\">mutate()</span>.&nbsp;&nbsp;</div><div><br></div><div>This final output is much more useful for answering our motivating question.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1726853488967-Mutate5.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/mutate.r","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}]};
